import React from 'react';
import Navbar from '../navSection/Navbar';
import Map from '../component/Map';
import HouseOutlinedIcon from '@mui/icons-material/HouseOutlined';
import Cards from '../component/Cards';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { Link } from 'react-router-dom';
import './homePage.css';
import Kitchen from '../kitchenSection/Kitchen';
import Carousel from 'react-bootstrap/Carousel';
import KitchenBox from '../component/KitchenBox';

const data = [
  {
    name: 'jolof rice',
    desc: 'nigeria jolof',
    price: 1200,
    _id: 'kzd',
    kitchenName: 'iyah-dolof kitchen',
    kitchenRating: 3.5,
    verified: true,
    physicalAddress: '30 udeji street lagos island',
    status: 'available',
    content: ['2 portions of rice', '1 chicken lap'],
    img: 'https://cdn.filestackcontent.com/5ngAPL80SuCvpsEb7S2f',
  },
  {
    name: 'amala and ewedu',
    desc: 'hot delicious amala and ewedu',
    content: [
      '1 chicken lap',
      'a bow of soup',
      '2 wraps of amala',
      '4 pieces of beef',
    ],
    price: 700,
    _id: 'kzd28',
    kitchenName: 'iyah-dolof kitchen',
    kitchenRating: 1.5,
    verified: true,
    physicalAddress: '30 udeji street lagos island',
    status: 'available',
    img: 'https://www.shutterstock.com/image-photo/top-view-meal-nigerian-amala-600nw-1386416945.jpg',
  },
];


const carouselData = [
    {
      kitchenImg:
        'https://www.plotprojects.com/wp-content/uploads/2023/05/rsz_best_delivery_management_software.jpg',
        kitchenName:"delux kitchen",
        deliveryRate: 30,
        rating:3.5,
        verified: true,
  
    },
    {
      kitchenImg:
        'https://img.freepik.com/premium-vector/online-parcel-delivery-service-concept-mobile-app-concept-hand-holding-phone-with-parcel-delivery-application-display-courier-carries-cart-with-boxes-orders-truckflat-illustration_608021-195.jpg?w=360',
        kitchenName:"chef bobby",
        deliveryRate: 45,
        rating:4.5,
        verified: true,
    },
  ];
  
function HomePage() {
  return (
    <div style={{  }}>
      <Navbar />
      <Map />
      <div className="my-3 d-flex justify-content-center">
        {' '}
        <h3 className="border-bottom border-secondary">
          We diliver to your door-step
          <HouseOutlinedIcon className="fs-1 text-success" />
        </h3>
      </div>
      <div className="d-flex gap-3 justify-content-center align-items-center my-3">
        {data.map((item) => (
          <Link key={item._id} className="box">
            <Cards item={item} />
          </Link>
        ))}
      </div>

      <div className='d-fleX  my-5' style={{border:"1px solid red", width:"90%", margin:"auto"}}>
        <Row style={{ }}>
          <Col style={{  }} md={6}>
            <div style={{ height: "100%", alignItems: "center" }} className="d-flex justify-content-center">
              <ul>
                <li>Budget-friendly options for every customer</li>
                <li>Guaranteed 100% delivery success rate</li>
                <li>Wide variety of cuisines to satisfy diverse tastes</li>
                <li>Efficient and timely delivery services</li>
                <li>User-friendly mobile app for seamless ordering</li>
              </ul>
            </div>
          </Col>
          <Col md={6} style={{   }}>
            <Carousel style={{ }}>
            {/* <div style={{ height: "100%", alignItems: "center" }} className="d-flex justify-content-center">
              <ul>
                <li>Budget-friendly options for every customer</li>
                <li>Guaranteed 100% delivery success rate</li>
                <li>Wide variety of cuisines to satisfy diverse tastes</li>
                <li>Efficient and timely delivery services</li>
                <li>User-friendly mobile app for seamless ordering</li>
              </ul>
            </div> */}
              {carouselData.map((item) => (
                <Carousel.Item style={{height:"250px", Width:"100%"}}>
                  
                  <img style={{width:"100%", }} src={item.kitchenImg} alt=""/>
                </Carousel.Item>
              ))}
            </Carousel>
          </Col>
        </Row>
      </div>
      
    </div>
  );
}

export default HomePage;
